import { WRITE_ROOM_ID } from '../actiontypes';
import { WRITE_ROOM_CONFIG } from '../actiontypes';

// user => {username: "catdev", color: "#fff"}
export function writeRoomId(id) {
  return {
    type: WRITE_ROOM_ID,
    payload: id,
  };
}

export function writeRoomConfig(config) {
  return {
    type: WRITE_ROOM_CONFIG,
    payload: config,
  };
}
